import Day5 from './index';

describe('Day #5', function () {
    
    let input;
    
    beforeEach(function () {
       input = '';
    });
    
    describe('Part #1', function () {
        
        it('should return the correct polymer after destruction', function () {
            expect(Day5.react('dabAcCaCBAcCcaDA'))
                .toEqual('dabCBAcaDA')
        });
        
        it('should return the correct value', function () {
            expect(Day5.react('aabAAB')).toEqual('aabAAB')
        });

        it('should return the correct output length', function () {
            expect(Day5.react(input).length).toEqual(11754);
        });
    });

    describe('Part #2', function () {
        
        it('should return a list of polymer lengths for each char', function () {
            expect(Day5.getSmallestPolymer(input)).toEqual(4098);
        });
        
    });
    
});